import React, { Component } from 'react'
import './IndexL.css'

export default class Index extends Component {
    render() {
        return (
            <div className="adminpage">

                <button style={{
                    width: 100,
                    height:30

                }}>Admin</button>

                <div className="btn-admin">

                    <button>หน้าหลัก</button>
                    <button>ระบบสมาชิก</button>
                    <button>เช็คสถานะห้อง</button>
                    <button>เพิ่ม ลบ แก้ไขห้องพัก</button>
                    <button>ประเภทห้องพัก</button>
                    <button>ประชาสัมพันธ์</button>
                    <button>แบรนเนอร์</button>
                    <button>GoogleMap</button>
                    <button>สถานะชำระเงิน</button>
                    <button>ประวัติการจอง</button>

                </div>

            </div>
        )
    }
}
